import React from "react";
import { Outlet } from "react-router-dom";
import Navigation from "../components/nav";
import Footer from "../components/footer";

const Root = () => {
    return (
        <>
            <header>
                <h1>Soomin<br/>Chung</h1>
                <Navigation />
            </header>
            <Outlet />
            <Footer />
        </>
    );
};

export default Root;
